from typing import List

# 2785. Sort Vowels in a String
VOWELS = ["a", "e", "i", "o", "u", "A", "E", "I", "O", "U"]


class Solution:
    def sortVowels(self, s: str) -> str:
        ss = list(s)
        print("list of vowels")
        vowels = [c for c in ss if c in VOWELS]
        idx = [i for i, c in enumerate(ss) if c in VOWELS]
        vowels.sort()
        d = {k: v for k, v in zip(idx, vowels)}
        for i, c in enumerate(ss):
            ss[i] = d.get(i, ss[i])
        return "".join(ss)


s = Solution()
assert s.sortVowels("lEetcOde"), "lEOtcede"

assert s.sortVowels("lYmpH"), "lYmpH"

print(
    s.sortVowels(
        ""
    )
)
